Prezado(a) Senhor(a),

Para dar continuidade à instrução do processo de naturalização, devem ser anexados os documentos abaixo relacionados:

1. Certidão de antecedentes criminais emitida pela Justiça Federal e Estadual dos locais onde residiu nos últimos quatro anos (sites do TRF1 e TJDFT);
2. Comprovante de residência, no nome do requerente;
3. Cópia do documento de viagem internacional, ainda que vencido, observadas as regras do Mercosul (todas as páginas do passaporte).

Caso o(s) documento(s) não seja(m) apresentado(s) em 30 (trinta) dias, o processo será encaminhado, com os documentos juntados até aquele momento, ao Ministério da Justiça. Tal prazo poderá ser prorrogado, caso necessário, mediante requerimento e justificativa do requerente.

